import React, {useState} from 'react'

import { Button,Container,Nav,Navbar,NavDropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './MyNav.css';

import Connection from "./Connection";
import App from "./App";

import Hunt1 from "./Hunt1";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



const Hunt2 = () => {
  return(
    <div>Hello Hunt 2</div>
  )
}

const Hunt3 = () => {
  return(
    <div>Hello Hunt 3</div>
  )
}

const MyNav = (props) => {



  return(

    <Navbar collapseOnSelect className="fixed-top MyBakground" expand="lg" variant="dark">
      <Container>
      <Navbar.Brand href="#home">In Nav.js</Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="me-auto">
          <Link className='customLinks' to="/home">
          Home
          </Link>
          <Link className='customLinks' to="/hunt1">
          Hunt 1
          </Link>
          <Link className='customLinks' to="/hunt2">
          Hunt 2
          </Link>
          <Link className='customLinks' to="/hunt3">
          Hunt 3
          </Link>

        </Nav>
        <Nav className="me-auto">
        <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
          <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown>

          <Connection accounts={props.accounts}/>

        </Nav>
      </Navbar.Collapse>
      </Container>
    </Navbar>



  );


};

export default MyNav;
